import React from "react";
import "../Style/Community.css";
import Menubar from "./Menubar";

function Community() {
  return (
    <div className="App">
      <Menubar></Menubar>
      <div className="App-content-Blog">
        <h1>커뮤니티</h1>
      </div>
    </div>
  );
}

export default Community;
